    return (
      <div>
        <dl style={{listStyle: 'none'}}>
        {props.searchResults.map(result => 
          <dt key={result.name}>{result.name} {result.number} {' '} 
          <button onClick={()=>props.deleteNameOf(result.id)}>delete</button>
          </dt>
        )}
        </dl>
      </div>
    )
  }

